import React, { useEffect, useRef, useState } from 'react'
import { makeStyles } from '@material-ui/core/styles'

const Marker = props => {
  const [marker, setMarker] = useState({})

  const initMarker = () => {
    const map = new google.maps.Marker({map: props.map})
    setMarker(marker)
  }

  return (
    <div />
  )
}

export default Marker
